<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="UTF-8" />
  <style>
    @page {
      size: 150.87px 70.08px;
      margin: 0;
    }
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
    }

    body {
      background-color: #f9f9f9;
      display: flex;
      justify-content: center;
      align-items: center;
      margin: 0;
    }

    .label-card {
      background-color: #fff;
      border: 1px solid black;
      border-radius: 5px;
      box-shadow: 0 2px 8px rgba(0, 0, 0, 0.1);
      text-align: left;
      font-size: 14px;
      overflow: hidden;
    }

    .brand {
      padding: 2px 5px;
      display: flex;
      justify-content: space-between;
      border-bottom: 1px solid black;
      height: 4mm;
    }

    .brand h2 {
      font-size: 15px;
      color: #000;
    }

    .brand p {
      color: black;
      font-size: 3px;
      line-height: 5px;
    }

    .product-info {
      padding: 1px 5px;
      max-height: 23.5mm;
      min-height: 30px;
      overflow: hidden;
    }

    .product-info p {
      font-size: 5px;
      white-space: nowrap;
      line-height: 7px;
    }

    .up {
      align-items: center;
      display: flex;
    }

    .icons span {
      font-size: 18px;
      font-weight: bold;
    }

    .down .barcode {
      width: 120px;
      height: 10px;
    }

    .product-info .trash {
      width: 50px;
    }

    .icons {
      float: right;
    }

    .icons img {
      width: 50px;
      height: 20px;
    }

    .symb {
      font-size: 15px;
      line-height: 0;
    }

    .amp {
      display: flex;
      align-items: center;
    }

    .brand {
      overflow: hidden;
      display: flex;
      align-items: center;
    }

    .brand .brand_img {
      width: 50px;
      height: 10px;
    }

    .down {
      padding: 0 5px;
      font-size: 5px;
      overflow: hidden;
      line-height: 7px;
    }

    .country {
      display: flex;
      justify-content: space-between;
    }
  </style>
</head>
